##K: specj. ##D: instrument wykorzystywany dawniej przez kurierów pocztowych;
zbliżający się do stacji pocztowej kurier dął w trąbkę dzięki czemu jego zmiennik mógł zawczasu przygotować się do przesyłki i szybciej wyruszać w drogę.
{##L: http://pl.wikipedia.org/wiki/Tr%C4%85bka_pocztowa} <##nDD>

##K: og.
##D: słodkie lub półsłodkie wino, podawane zazwyczaj po jedzeniu, do ciast i deserów. {##L: http://pl.wikipedia.org/wiki/Wino_deserowe}
<##nDD>

##K: specj.
##D: czujnik przeznaczony do detekcji bardzo małych zmian masy. {##L: http://pl.wikipedia.org/wiki/Mikrowaga_kwarcowa}
<##nDD>

##K: og. ##D: osoba zajmująca się konserwacją, renowacją, rekonstrukcją, zabezpieczaniem zabytków, w tym przedmiotów znalezionych przez archeologów. [##P: Ola skończyła ASP, żeby zostać konserwatorem zabytków, najbardziej marzy o pracy przy renowacji obrazów.] {##L: http://pl.wikipedia.org/wiki/Konserwator_zabytk%C3%B3w}
